            String seventh_sem =jTextField45.getText();
            String eight_sem =jTextField46.getText();
            String ten_grade =jTextField47.getText();
            String twelve_grade =jTextField48.getText();
            String favourite_sub =jTextField49.getText();
            String career_obj =jTextField50.getText();
