            ResultSet rs = st.executeQuery("select * from student");
            st.executeUpdate("insert into student values('"+name+"','"+roll_no+"','"+stream+"','"+year+"','"+section+"','"+semester+"','"+guardian_name+"','"+address+"','"+email+"','"+phone_no+"','"+date_of_birth+"','"+first_sem+"','"+second_sem+"','"+third_sem+"','"+fourth_sem+"','"+fifth_sem+"','"+sixth_sem+"','"+seventh_sem+"','"+eight_sem+"','"+favourite_sub+"','"+career_obj+"','"+hobbies+"','"+ten_grade+"','"+twelve_grade+"')");

            rs.close();
            con.close();
